import State2 from "./state2.js"
import { useState } from "react";
import { getDefaultNormalizer } from "@testing-library/react"


// Const [state,setState]=useState("vijay")
function State(){
  const [id,setId]=useState("01")
  const [sur,setSur]=useState("Thummuru")
  const [name,setName]=useState("Nishanth")
  const [city,setCity]=useState("bengaluru")
  const [value,setValue]=useState("0")

  const change=()=>{
    setId("02")
    setSur("T")
    setName("Nikhil")
    setCity("Bangalore")
  
  }
  const increment=()=>{
    setValue(value+1)

  }
  
  return(
    <div>
      <h1>we are using useState()</h1>
      <h2>Count:{value}</h2>
      <button onClick={increment}>INC</button>
      <button>DEC</button>
 <State2    id={id} sur= {sur} name={name} city={city}   />
      <button onClick={change}>Update</button>
    </div>
  )
}
export default State;
